function HeaderRightButtons(props) {
  return (
      <div className="flex-col">

    <ul class="navbar-nav me-auto mb-2 mb-lg-0">
      <li class="nav-item">
        <button className="ms-2 btn btn-success">Sign In</button>
      </li>
      <li class="nav-item">
        <button className="ms-1 btn btn-primary">Sign Up</button>
      </li>
    </ul>
    </div>
  );
}

export default HeaderRightButtons;
